script: |
  super -f text -I q5651.spq | sort > q5651.out

inputs:
  - name: q5651.spq
    data: |
      SELECT DISTINCT * FROM tab1 (FORMAT parquet) AS cor0 WHERE + 2 NOT IN ( 3, ( + + col2 ) + + col0, + + col0 * - 72 * - col0 / - - 32 * - col0, - 46 * ( 93 ) * - + col0 );
  - name: tab1

outputs:
  - name: q5651.out
    data: |
      51	14	96
      85	5	59
      91	47	68
